import React, { useState, useEffect } from "react";

function Feedback() {
  const [feedbackList, setFeedbackList] = useState([]);
  
  useEffect(() => {
    getFeedbackList()
    })

  const getFeedbackList = () => {
    axios.get('https://reqres.in/api/users').then(res => {
      setFeedbackList(res.data.data);
    });
    const feedback = [
      {
        emailId: "4754",
        message:"Hi am very good...",
        
      },
      {
        emailId: "4784",
        message:"Hi am very  not kl...",
        
      },
      {
        emailId: "4784",
        message:"Hi am   n855",
        
      },
    ];
    setFeedbackList(feedback);
  };
 
  return (
    <div>
      <main className="mt-5 pt-2">
        <div className="container mt-2">
          {feedbackList.map((feedback, index) => (
          <ul className="list-group">
            <li className="list-group-item">
              <span className="font-weight-bold">Email ID : </span>
              <span className="">{feedback.emailId}</span>
            </li>

            <li className="list-group-item">
              <span className="font-weight-bold">Message : </span> <br />
              <span className="mt-2">{feedback.message}</span>
            </li>
            <hr/>
            </ul>
            ))}
         
        </div>
      </main>
    </div>
  );
}

export default Feedback;
